oxy_webhelp_navlinks = {"qauth_request_management-d22908e9303":{"topics":[{"title":"Quorum Authorization requests page","shortdesc":"<p class=\"shortdesc\">The Quorum Authorization requests page provides details about the requests submitted         for quorum authorization and the response options available for the requests. Although the         reviewers and requesters can view the same request details, the options available to respond         to the requests vary depending on the role of the user viewing the page.<\/p>","href":"qauth\/qauth_requests_page.html","attributes":{"data-id":"qauth_requests_page"},"menu":{"hasChildren":false},"tocID":"qauth_requests_page-d22908e9317","next":"qauth_requests_page-d22908e9317"},{"title":"Viewing quorum authorization requests","shortdesc":"<p class=\"shortdesc\">If you are assigned a role with the permission to view quorum authorization requests,         view a list of requests by navigating to the Quorum Authorization requests page. You can         also view the summary and history of each request.<\/p>","href":"qauth\/viewing_qauth_requests_page.html","attributes":{"data-id":"viewing_qauth_requests_page"},"menu":{"hasChildren":false},"tocID":"viewing_qauth_requests_page-d22908e9350","topics":[]},{"title":"Approving or denying a quorum authorization request","shortdesc":"<p class=\"shortdesc\">If you are a user with the QAuth administrator or QAuth approver role, review the         requests on the Quorum Authorization requests page and then approve or deny a request for         quorum authorization.<\/p>","href":"qauth\/approving_denying_qauth_requests.html","attributes":{"data-id":"approving_denying_qauth_requests"},"menu":{"hasChildren":false},"tocID":"approving_denying_qauth_requests-d22908e9361","topics":[]},{"title":"Canceling an action after requesting quorum authorization","shortdesc":"<p class=\"shortdesc\">To withdraw a quorum authorization request, cancel the requested action while the         request is in the Pending or Approved state.<\/p>","href":"qauth\/canceling_qauth_action.html","attributes":{"data-id":"canceling_qauth_action"},"menu":{"hasChildren":false},"tocID":"canceling_qauth_action-d22908e9372","topics":[]},{"title":"Running an action after obtaining quorum authorization","shortdesc":"<p class=\"shortdesc\">If you are a requester, run an action you requested after the request is approved         using quorum authorization. For you to be able to run the action, the action status of the         request must be Approved.<\/p>","href":"qauth\/running_qauth_action.html","attributes":{"data-id":"running_qauth_action"},"menu":{"hasChildren":false},"tocID":"running_qauth_action-d22908e9383","topics":[]}]}};